import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const Practise = () => {
  return (
    <View style={styles.container}>
      <Text style={styles.textStyle} >Login Form</Text>
    </View>
  )
}



const styles = StyleSheet.create({
    container:{
      marginTop:20,
      
    },
    textStyle:{
        textAlign:'center',
    }
})

export default Practise;
